import './App.css';
import React, { useState, useEffect } from 'react';
import {Header, Button} from './components/common';
import Background from './background.svg';
function App() {
  return (
    <div className="App"style={{
      backgroundImage: `url(${Background})` }}>
      <Header/>
      <button >hello</button>
    </div>
  );
}

export default App;
